import { DEFAULT } from "@/layouts";
export default [
  {
    path: "/test",
    name: "test",
    component: DEFAULT,
    redirect: "/test",
    children: [
      {
        path: "/test",
        name: "test-index",
        component: () => import("../../views/test/index.vue"),
      },
    ],
  },
  {
    path: "/test/test2",
    name: "test-test2",
    component: () => import("../../views/test/test2.vue"),
  },
];
